      </p>
      <div>
      <input className='f4 pa2 w-70 center' type='tex' />
      <button className='w-30 grow f4 link ph4 pv2 dib white bg-light-red'>Detect</button>
      </div>
    </div>
  );
}

export default ImageLinkForm;
